post_text:
The RSU 22 Board of Directors Meeting agenda is available at https://drive.google.com/open?id=10YxMk7q2qP4yhJ4-34oD9Wr3tGVnjeT7. Please note that we will be maintaining time for persons desiring to address the Board. In the interest of Social Distancing you may e-mail you comments to:
-Richard Lyons, Superintendent of Schools: rlyons@rsu22.us;
-Karen Hawkes, Chair, RSU 22 Board: khawkes@rsu22.us;
-Regan Nickels, Assistant Superintendent for Business, rnickels@rsu22.us;
-Heath Miller, Vice-Chair, RSU 22 Board; hmiller@rsu22.us;
or any other Director on the Board (https://rsu22.us/about/board).
If other methods of addressing the Board are available, they will be posted here, before the meeting,

